import { useRef, useState } from "react";
import Navbar from "../Navbar";
import StripPanel from "./StripPanel";
import { useDispatch, useSelector } from "react-redux";
import Modal from 'react-modal';
import StripImage from "./StripImage";
import { onSubmitClick, toggleImageEditModalState } from "../../redux/comicPanelSlice";
import { renderToString } from 'react-dom/server';
import html2canvas from "html2canvas";

Modal.setAppElement('#root');

export default function ComicStrip() {

    const comicPanelState = useSelector((state) => state.comicPanel);
    let dispatch = useDispatch();
    let promptRef = useRef(null), textRef = useRef(null), imageRef = useRef(null);

    console.log(comicPanelState);

    function closeModal() {
        dispatch(toggleImageEditModalState());
    }

    async function getCanvasShareableURL() {
        let imageElement = document.getElementById("strip-panel");
        console.log(imageElement);
        const canvas = await html2canvas(imageElement);
        const dataURL = canvas.toDataURL("image/png", 1.0);
        console.log(dataURL);
        let base64Source=dataURL.substring(22);
        const formData = new FormData();
        formData.append('image',base64Source);
        await fetch(
            "https://api.imgbb.com/1/upload?key=eadbc9aab19929c876996b5f182e4873",
            {
                method: "POST",
                body: formData
            }
        ).then((resp) => resp.json()).then((r) => console.log(r.data));
    }

    async function onSubmit() {
        console.log(promptRef.current.value);
        console.log(textRef.current.value);

        const response = await fetch(
            "https://xdwvg9no7pefghrn.us-east-1.aws.endpoints.huggingface.cloud",
            {
                headers: {
                    Accept: "image/png",
                    Authorization: "Bearer VknySbLLTUjbxXAXCjyfaFIPwUTCeRXbFSOjwRiCxsxFyhbnGjSFalPKrpvvDAaPVzWEevPljilLVDBiTzfIbWFdxOkYJxnOPoHhkkVGzAknaOulWggusSFewzpqsNWM",
                    "Content-Type": "application/json",
                },
                method: "POST",
                body: JSON.stringify({ "inputs": promptRef.current.value }),
            }
        );
        const result = await response.blob();

        let url = URL.createObjectURL(result);

        dispatch(onSubmitClick({ prompt: promptRef.current.value, text: textRef.current.value, url: url }));
    }

    return <div>
        <Navbar />
        <Modal
            isOpen={comicPanelState.imageEditModalState}
            onRequestClose={closeModal}>
            <div class="w-full">
                <div class="px-8 pt-6 pb-4 ">
                    <button onClick={closeModal} class="bg-blue-500 hover:bg-blue-700 py-2 px-4 text-white font-bold rounded focus:outline-none focus:shadow-outline">close</button>
                </div>
                <form class="bg-white rounded px-8 pt-4 pb-8 mb-4">
                    <div class="mb-4">
                        <label class="block text-gray-700 text-sm font-bold mb-2" for="username">
                            Prompt
                        </label>
                        <input ref={promptRef} class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="prompt" type="text" placeholder="Cowboy riding a bike" />
                    </div>
                    <div class="mb-4">
                        <label class="block text-gray-700 text-sm font-bold mb-2" for="username">
                            Strip Text
                        </label>
                        <input ref={textRef} class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="strip-text" type="text" placeholder="Hui Hui" />
                    </div>
                    <div class="flex items-center justify-between">
                        <button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline" type="button" onClick={onSubmit}>
                            Confirm
                        </button>
                    </div>
                    <img src={comicPanelState.stripImages[comicPanelState.currIdx].imageURL} ref={imageRef} />
                </form>
            </div>
        </Modal>
        <div class="px-8 pt-6 pb-4 ">
            <button onClick={getCanvasShareableURL} class="bg-blue-500 hover:bg-blue-700 py-2 px-4 text-white font-bold rounded focus:outline-none focus:shadow-outline">Get Canvas URL</button>
        </div>
        <div id="strip-panel">
            <StripPanel />
        </div>
    </div>;
}

